import React from "react";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import "./App.css";
import CreditScoringList from "./CreditScoringList";
import CreditScoringCard from "./CreditScoringCard";

function App() {
  return (
    <Router>
      <div className="App">
        <Link to="/add-scorecard">
          <button type="button" className="btn2">
            Add ScoreCard
          </button>
        </Link>
        <Switch>
          <Route exact path="/add-scorecard" component={CreditScoringCard} />
          <Route path="/" component={CreditScoringList} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
